import React from 'react';
import {  Link } from "react-router-dom";


const Navbar= () =>{
  return (
  <div>
    <li>
      <Link to="/src/pages/projects">Projects</Link>
    </li>
    <li>
      <Link to="/">About Me</Link>
    </li>
    <li>
      <Link to="/">Contact</Link>
    </li>
    <li>
      <Link to="/">About This Project</Link>
    </li>
  </div>
  );
}


export default Navbar;
